//Funktionen
function sucheOben(array, grenze){
    var x = 1000000;
    for(var i = 0; i < array.length; i++){
      if(array[i] === grenze)
        return array[i];
      else{
        if((array[i] > grenze) && (Math.abs(array[i]-grenze) <= Math.abs(x-grenze)))
          x = array[i];
      }
    }
    return x;
  }
function sucheUnten(array, grenze){
    var x = 1000000;
    for(var i = 0; i < array.length; i++){
      if(array[i] === grenze)
        return array[i];
      else{
        if((array[i] < grenze) && (Math.abs(array[i]-grenze) <= Math.abs(x-grenze)))
          x = array[i];
      }
    }
    return x;
  }
  function sucheOben2(array, grenze){
      var x = 1000000;
      for(var i = 0; i < array.length; i++){
        if((array[i] > grenze) && (Math.abs(array[i]-grenze) <= Math.abs(x-grenze)))
          x = array[i];
      }
      return x;
    }
  function sucheUnten2(array, grenze){
      var x = 1000000;
      for(var i = 0; i < array.length; i++){
        if((array[i] < grenze) && (Math.abs(array[i]-grenze) <= Math.abs(x-grenze)))
          x = array[i];
      }
      return x;
    }
function randomRange(minGrenze, maxGrenze){
    var a = postZahlen.indexOf(sucheOben(postZahlen, minGrenze));
    var b = postZahlen.indexOf(sucheUnten(postZahlen, maxGrenze));
    var c = Math.floor(Math.random()*(b-a+1)+a);
    return c;
  }
function randomPick(array){
  return array[(Math.floor(Math.random()*(array.length)))]
}
function randomRangeAusland(minGrenze, maxGrenze){
  return Math.floor(Math.random()*(maxGrenze-minGrenze+1)+minGrenze);
}
function munze(wahrscheinlichkeit){
  if(Math.random() > wahrscheinlichkeit)
    return false;
  else
    return true;
}
function arrayErweitern(array){
  var unten, oben;
  if(array[array.length-1] >= postZahlen[postZahlen.length-1] || (array[0] <= postZahlen[0])){
    array.pop();
    array.shift();
  }
  else{
    unten = randomRange(postZahlen[0], sucheUnten2(postZahlen, array[0]));
    oben  = randomRange(sucheOben2(postZahlen, array[array.length-1]) , postZahlen[postZahlen.length-1]);
    array.push(postZahlen[oben]);
    array.unshift(postZahlen[unten]);
  }
}
